import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <input type="text" />
        <div
          className="colorbox"
          style={{
            width: '50vw',
            height: '50vh',
            background: 'black',
            display: 'block',
            marginleft: 'auto',
            marginright: 'auto',
          }}
        />
      </div>
    );
  }
}

export default App;
